  return (
    <Container fluid>
     <Row className="home_row">
      <h1 className="title"> Chloe & Charles </h1>
      {/* <img class="landing_image" src='/images/engagement_1.JPG'/> */}
      </Row>
    </Container>
  );
}

export default Home;
